CREATE TABLE IF NOT EXISTS Users (
    `user_id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `username` VARCHAR(20) NOT NULL,
    `password` VARCHAR(128) NOT NULL
);
CREATE TABLE IF NOT EXISTS categories (
    `list_objectID` INT,
    `list_parent_id` INT,
    `list_name` VARCHAR(65) CHARACTER SET utf8,
    `list_is_active` VARCHAR(5) CHARACTER SET utf8,
    `list_position` INT,
    `list_level` INT,
    `list_product_count` INT,
    `list_tree` VARCHAR(65) CHARACTER SET utf8,
    `list_ids` INT,
    `list_path` VARCHAR(66) CHARACTER SET utf8,
    `list_name_ar` VARCHAR(165) CHARACTER SET utf8,
    `list_tree_ar` VARCHAR(180) CHARACTER SET utf8
);
